('BABA', 'Common Stock', 'Alibaba Group Holding Limited', 'Alibaba Group Holding Limited, through its subsidiaries, provides online and mobile commerce businesses in the People\'s Republic of China and internationally. It operates through four segments: Core Commerce, Cloud Computing, Digital Media and Entertainment, and Innovation Initiatives and Others. The company operates Taobao Marketplace, a mobile commerce destination; Tmall, a third-party online and mobile commerce platform for brands and retailers; Alibaba Health Internet platforms for pharmaceutical and healthcare products; Alimama, a monetization platform; 1688.com and Alibaba.com, which are online wholesale marketplaces; AliExpress, a retail marketplace; Lazada, an e-commerce platform; and Tmall Global, an import e-commerce platform. It also operates Lingshoutong, a digital sourcing platform; Cainiao Network logistic services platform; Ele.me, a delivery and local services platform; Koubei, a restaurant and local services guide platform; and Fliggy, an online travel platform. In addition, the company offers pay-for-performance and display marketing services; and Taobao Ad Network and Exchange, a real-time bidding online marketing exchange. Further, it provides elastic computing, database, storage, virtualization network, large-scale computing, security, management and application, big data analytics, and Internet of Things and other services for enterprises; payment and escrow services; and movies, television series, variety shows, animations, and other video content. Additionally, the company operates Youku, an online video platform; Alibaba Pictures and other content platforms that provide online videos, films, live events, news feeds, literature, music, and others; Amap, a mobile digital map, navigation, and real-time traffic information app; DingTalk, a business efficiency app; and Tmall Genie, an AI-powered smart speaker. The company was founded in 1999 and is based in Hangzhou, the People\'s Republic of China.', 'NYSE', 'USD', 'USA', 'Consumer Cyclical', 'Internet Retail', '969 West Wen Yi Road, Hangzhou, China, 311121', '122399'),
('MRNA', 'Common Stock', 'Moderna, Inc', 'Moderna, Inc., a clinical stage biotechnology company, develops therapeutics and vaccines based on messenger RNA for the treatment of infectious diseases, immuno-oncology, rare diseases, and cardiovascular diseases. As of February 15, 2019 the company had 11 programs in clinical trials and a total of 20 development candidates in six modalities comprising prophylactic vaccines, cancer vaccines, intratumoral immuno-oncology, localized regenerative therapeutics, systemic secreted therapeutics, and systemic intracellular therapeutics. The company has strategic alliances with AstraZeneca, Merck & Co., Vertex Pharmaceuticals, Biomedical Advanced Research and Development Authority, Defense Advanced Research Projects Agency, and Bill & Melinda Gates Foundation; and a research collaboration with Harvard University. Moderna, Inc. also has collaborations with Lonza Ltd. for the manufacture of mRNA-1273, a COVID-19 vaccine; and Catalent for fill-finish manufacturing of its COVID-19 vaccine candidate. The company was formerly known as Moderna Therapeutics, Inc. and changed its name to Moderna, Inc. in August 2018. Moderna, Inc. was founded in 2010 and is headquartered in Cambridge, Massachusetts.', 'NASDAQ', 'USD', 'USA', 'Healthcare', 'Biotechnology', '200 Technology Square, Cambridge, MA, United States, 02139', '1100'),
('MSFT', 'Common Stock', 'Microsoft Corporation', 'Microsoft Corporation develops, licenses, and supports software, services, devices, and solutions worldwide. Its Productivity and Business Processes segment offers Office, Exchange, SharePoint, Microsoft Teams, Office 365 Security and Compliance, and Skype for Business, as well as related Client Access Licenses (CAL); Skype, Outlook.com, and OneDrive; LinkedIn that includes Talent, Learning, Sales, and Marketing solutions, as well as premium subscriptions; and Dynamics 365, a set of cloud-based and on-premises business solutions for small and medium businesses, large organizations, and divisions of enterprises. Its Intelligent Cloud segment licenses SQL and Windows Servers, Visual Studio, System Center, and related CALs; GitHub that provides a collaboration platform and code hosting service for developers; and Azure, a cloud platform. It also offers support services and Microsoft consulting services to assist customers in developing, deploying, and managing Microsoft server and desktop solutions; and training and certification to developers and IT professionals on various Microsoft products. Its More Personal Computing segment provides Windows original equipment manufacturer (OEM) licensing and other non-volume licensing of the Windows operating system; Windows Commercial, such as volume licensing of the Windows operating system, Windows cloud services, and other Windows commercial offerings; patent licensing; Windows Internet of Things; and MSN advertising. It also offers Surface, PC accessories, PCs, tablets, gaming and entertainment consoles, and other intelligent devices; Gaming, including Xbox hardware, and Xbox content and services; video games and third-party video game royalties; and Search, including Bing and Microsoft advertising. It sells its products through OEMs, distributors, and resellers; and directly through digital marketplaces, online stores, and retail stores. The company was founded in 1975 and is headquartered in Redmond, Washington.', 'NASDAQ', 'USD', 'USA', 'Technology', 'Software-Infrastructure', 'One Microsoft Way, Redmond, WA, United States, 98052-6399', '163000'),
('SAN', 'Common Stock', 'Banco Santander, S.A', 'Banco Santander, S.A., together with its subsidiaries, provides various retail and commercial banking products and services to individuals, small and medium-sized enterprises, and large companies worldwide. It offers demand and time deposits, and current and savings accounts; mortgages, consumer finance, auto finance, and personal loans; export and agency finance, trade and working capital solutions, syndicated corporate loans, and structured financing; debt capital markets and global markets services; insurance products; and debit and credit cards. The company also provides cash management, transactional, payrolls, and wealth management services. In addition, it is involved in the corporate banking, treasury, and investment banking activities; leasing, securitization, management of funds and portfolios, e-commerce, technology services, air transport, renting, insurance brokerage, aircraft rental, payments and collection, reinsurance, securities investment, sports, electricity production, IT, Internet, and financial advisory and other activities; and purchase and sale of vehicles. Further, the company offers asset management, private, mobile, and online banking services, as well as develops, invests in, manages, and rents real estate properties. It operates through a network of 11,952 branches. The company was formerly known as Banco Santander Central Hispano S.A. and changed its name to Banco Santander, S.A. in June 2007. Banco Santander, S.A. was founded in 1856 and is headquartered in Madrid, Spain.', 'NYSE', 'USD', 'USA', 'Financial Services', 'Banks-Diversified', 'Santander Group City, Madrid, Spain, 28660', '192578'),
('SNAP', 'Common Stock', 'Snap Inc', 'Snap Inc. operates as a camera company in the United States and internationally. The company offers Snapchat, a camera application that helps people to communicate through short videos and images called Snaps. It also provides Camera, a tool to personalize and add context to Snaps; Chat that allows creating and watching stories, chatting with groups, making voice and video calls, and communicating through a range of contextual stickers and Bitmojis; and Discover that helps surfacing the stories and shows from publishers, creators, and the community based on a user\'s subscriptions and interests. In addition, the company offers Snap Map, which brings to a live map of individual location, showing nearby friends, popular stories, and a heatmap of recent snaps posted; Memories that allows users to choose to save the Snaps they create in a searchable personal collection, and users to create Snaps and stories from their saved Snaps and camera roll; and Spectacles, a hardware product that connects with Snapchat and captures video from a human perspective. The company was formerly known as Snapchat, Inc. and changed its name to Snap Inc. in September 2016. Snap Inc. was founded in 2010 and is headquartered in Santa Monica, California.', 'NYSE', 'USD', 'USA', 'Communication Services', 'Internet Content & Inform', '2772 Donald Douglas Loop North, Santa Monica, CA, United States, 90405', '3713'),
('TSLA', 'Common Stock', 'Tesla, Inc', 'Tesla, Inc. designs, develops, manufactures, leases, and sells electric vehicles, and energy generation and storage systems in the United States, China, Netherlands, Norway, and internationally. The company operates in two segments, Automotive; and Energy Generation and Storage. The Automotive segment offers sedans and sport utility vehicles. It also provides electric powertrain components and systems; and services for electric vehicles through its company-owned service locations, and Tesla mobile service technicians, as well as sells used vehicles. This segment markets and sells its products through a network of company-owned stores and galleries, as well as through its own Website. The Energy Generation and Storage segment offers energy storage products, such as rechargeable lithium-ion battery systems for use in homes, industrial, commercial facilities, and utility grids; and designs, manufactures, installs, maintains, leases, and sells solar energy generation and energy storage products to residential and commercial customers. It also provides vehicle insurance services, as well as renewable energy. The company was formerly known as Tesla Motors, Inc. and changed its name to Tesla, Inc. in February 2017. Tesla, Inc. was founded in 2003 and is headquartered in Palo Alto, California.', 'NASDAQ', 'USD', 'USA', 'Consumer Cyclical', 'Auto Manufacturers', '3500 Deer Creek Road, Palo Alto, CA, United States, 94304', '48016');
